import React, { Component } from "react";
import "./styleBooking.css";

export default class Bookingmovie extends Component {
  render() {
    return (
      <div
        className="bookingMovie"
        style={{
          position: "fixed",
          width: "100%",
          height: "100%",
          backgroundImage: "url('./img/bookingmovie/bgmovie.jpg')",
          backgroundSize: "100%",
        }}
      >
        <div
          style={{
            position: "fixed",
            width: "100%",
            height: "100%",
            backgroundColor: "rgb(0,0,,0.7)",
          }}
        >
          <div className="container-fluid">
            <div className="row">
              <div className="col-8 text-center">
                <div className="display-4 text-warning mt-5"> TRẦN XUÂN NGỌC</div>
                <div className="mt-3 text-light" style={{ fontSize: "25px" }}>Màn Hình</div>
                <div className="mt-2" style={{display: "flex",flexDirection: "row",justifyContent: "center",}}>

                  <div className="screen"></div>
                </div>
              </div>
              <div className="col-4 text-center">
                <div className="display-4 text-warning mt-2" style={{fontSize:'35px'}}> DANH SÁCH GHẾ</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
